import { BrowserRouter, Routes, Route } from "react-router-dom";
import './App.css';
import LoginPage from "./components/login/LoginPage";

function App() {
  return (
    <BrowserRouter>
      <Routes>

          <Route index element={<LoginPage   />} />
          {/* <Route path="blogs" element={<Blogs />} />
          <Route path="contact" element={<Contact />} />
